import TextureInstance from "../../engine/libs/instances/TextureInstance"
import Icon from "../libs/Icon"
import * as cameraShaderCode from "../templates/GIZMO.glsl"
import * as iconShaderCode from "../templates/ICON.glsl"
import ShaderInstance from "../../engine/libs/instances/ShaderInstance"
import COMPONENTS from "../../engine/data/COMPONENTS"
import VBOInstance from "../../engine/libs/instances/VBOInstance"
import pointLightIcon from "../../../data/icons/point_light.png"
import directionalLightIcon from "../../../data/icons/directional_light.png"
import probeIcon from "../../../data/icons/probe.png"
import LoopAPI from "../../engine/libs/apis/LoopAPI";
import RendererController from "../../engine/RendererController";
import CameraAPI from "../../engine/libs/apis/CameraAPI";
import EditorRenderer from "../EditorRenderer";

const CURSOR = "data:image/png;base64,"
const PLANE = new Float32Array([-1, -1, 0, 1, -1, 0, 1, 1, 0, 1, 1, 0, -1, 1, 0, -1, -1, 0])
let  transformationSystem
export default class IconsSystem {
    constructor() {
        this.renderers = {
            pointLights: new Icon(),
            directionalLights: new Icon(),
            probe: new Icon()
        }

        this.iconShader = new ShaderInstance(iconShaderCode.vertex, iconShaderCode.fragment)
        this.cameraShader = new ShaderInstance(cameraShaderCode.shadedVertex, cameraShaderCode.shadedFragment)
        this.selectedShader = new ShaderInstance(iconShaderCode.selectedVertex, iconShaderCode.selectedFragment)


        this.vao = gpu.createVertexArray()
        gpu.bindVertexArray(this.vao)

        this.vertexVBO = new VBOInstance(0, PLANE, gpu.ARRAY_BUFFER, 3, gpu.FLOAT, false)

        this.pointLightTexture = new TextureInstance(pointLightIcon, false)
        this.directionalLightTexture = new TextureInstance(directionalLightIcon, false)
        this.probeTexture = new TextureInstance(probeIcon, false)

        this.checkerboardTexture = new TextureInstance(CURSOR)


    }


    drawHighlighted(transformComponent, texture, forceAsIcon, iconSize) {
        gpu.disable(gpu.DEPTH_TEST)
        this.selectedShader.use()
        this.selectedShader.bindForUse({
            viewMatrix: CameraAPI.viewMatrix,
            transformMatrix: transformComponent.transformationMatrix,
            projectionMatrix: CameraAPI.projectionMatrix,
            sampler: texture,
            camPos: CameraAPI.position,
            translation: transformComponent.translation,
            forceAsIcon,
            iconSize,
            cameraIsOrthographic: CameraAPI.isOrthographic,
        })
        gpu.drawArrays(gpu.TRIANGLES, 0, 6)
        gpu.enable(gpu.DEPTH_TEST)
    }

    getIcon(entity) {
        const c = entity.components
        const isDLight = c[COMPONENTS.DIRECTIONAL_LIGHT] !== undefined
        const isPLight = c[COMPONENTS.POINT_LIGHT] !== undefined
        const isProbe = c[COMPONENTS.PROBE] !== undefined

        switch (true) {
            case isDLight:
                return this.directionalLightTexture.texture
            case isPLight:
                return this.pointLightTexture.texture
            case isProbe:
                return this.probeTexture.texture
            default:
                return
        }
    }


    #drawSelected(selected, iconSize) {
        for (let i = 0; i < selected.length; i++) {
            const entity = RendererController.entitiesMap.get(selected[i])
            if (!entity)
                continue
            const icon = entity.active ? this.getIcon(entity) : undefined
            if (icon) {
                this.drawHighlighted(
                    entity.components[COMPONENTS.TRANSFORM],
                    icon,
                    true,
                    iconSize
                )
            }
        }
    }

    #drawIcons(iconSize) {
        this.renderers.directionalLights.draw(
            this.directionalLightTexture.texture,
            iconSize,
            this.iconShader
        )
        this.renderers.pointLights.draw(
            this.pointLightTexture.texture,
            iconSize,
            this.iconShader
        )

        this.renderers.probe.draw(
            this.probeTexture.texture,
            iconSize,
            this.iconShader
        )
    }

    #drawCameras(cameras, selected) {
        if (cameras.length > 0) {
            this.cameraShader.use()
            gpu.bindVertexArray(EditorRenderer.cameraMesh.VAO)
            gpu.bindBuffer(gpu.ELEMENT_ARRAY_BUFFER, EditorRenderer.cameraMesh.indexVBO)
            EditorRenderer.cameraMesh.vertexVBO.enable()
            EditorRenderer.cameraMesh.normalVBO.enable()
            for (let i = 0; i < cameras.length; i++) {
                this.cameraShader.bindForUse({
                    viewMatrix: CameraAPI.viewMatrix,
                    transformMatrix: cameras[i].components[COMPONENTS.TRANSFORM].transformationMatrix,
                    projectionMatrix: CameraAPI.projectionMatrix,
                    axis: 3,
                    selectedAxis: selected.includes(cameras[i].id) ? 3 : 0
                })
                gpu.drawElements(gpu.TRIANGLES, EditorRenderer.cameraMesh.verticesQuantity, gpu.UNSIGNED_INT, 0)
            }
            gpu.bindVertexArray(null)
            EditorRenderer.cameraMesh.vertexVBO.disable()
            EditorRenderer.cameraMesh.normalVBO.disable()
        }

    }

    loop(ref) {
        const result = []
        const size = ref.length

        for (let i = 0; i < size; i++) {
            const current = ref[i]
            if (!current.active)
                continue
            result.push(current.components[COMPONENTS.TRANSFORM].transformationMatrix)
        }

        return result
    }

    execute() {
        const {
            pointLights,
            directionalLights,
            cameras,
            diffuseProbes,
            specularProbes
        } = RendererController.data
        const {
            iconsVisibility,
            iconSize,
            cursor,
            selected
        } = RendererController.params

        if (!transformationSystem)
            transformationSystem = LoopAPI.miscMap.get("transformations")

        if (window.renderer.entities.length !== this.lastSize || transformationSystem.hasUpdatedItem) {
            this.lastSize = window.renderer.entities.length

            this.renderers.directionalLights.updateBuffer(this.loop(directionalLights))
            this.renderers.pointLights.updateBuffer(this.loop(pointLights))
            this.renderers.probe.updateBuffer(this.loop([...diffuseProbes, ...specularProbes]))
        }

        if (iconsVisibility) {
            Icon.start(this.vertexVBO, this.vao, this.iconShader)
            this.#drawIcons(iconSize)
            this.#drawSelected(selected, iconSize)
            this.drawHighlighted(
                cursor.components[COMPONENTS.TRANSFORM],
                this.checkerboardTexture.texture
            )
            Icon.end(this.vertexVBO)

            this.#drawCameras(cameras, selected)
        }

        gpu.bindVertexArray(null)
    }


}